import React from "react";

function MemoDiv({memo,key}){
    return(
        <div className="memoElement" key ={key}>
            {memo}
        </div>
    )
}


function TodoMemoDivRender({renderList}){
    var returnList =[]
    var i=0;
    console.log(renderList);
    while(i<renderList.length){
        returnList.push(
        <div className="todoMainElement" key={renderList[i].todolist}>
            {renderList[i].todolist}
            {renderList[i].memolist.map(_memo=>(
                <MemoDiv memo={_memo} key={renderList[i].todolist}/>
            ))}
            {/* <MemoDiv memoList={renderList[i].memoList}></MemoDiv> */}
        </div>
        );

        i=i+1
    }
    return(
        returnList
    );
};

export default TodoMemoDivRender;
